(1581, '2015-05-13 10:12:38', NULL, 2844, 6404, 4760, 'Avería', 0, 0, 0, 1, 'Buenos días, \nMe pongo en contacto con vosotros ya que falta la rosca de la base de EDGE, la subjección.\nA la espera de vuestra respuesta, recibid un cordial saludo.\n', 'mpi\nenviar rosca + tornillo\n\ninvue', 'mueble samsung\n\nsamsung galaxy s6 edge cambiar rosca de la base . Alarma invue', '', '', '', '', '', 'rebeca mingo', '695197265', NULL, NULL, NULL, 'En visita', 'Comunicada'),
(1582, '2015-05-13 10:22:59', NULL, 2844, 6398, NULL, 'Avería', 0, 1, 0, 0, 'Buenos días, \nMe pongo en contacto con vosotros ya que en el mueble de Iphone le faltan las pilas y esta todo el día emitiendo un pitido por la falta de pilas.\nY a parte nos falta la lona nueva del iphone 6 seguimos teniendo la antigua lona del iphone 5s', 'mpi\n\nenviar pilas\n\nvpg', 'mueble iphone \n\ncambiar pilas a sistema de alarma general.  Alarmado VPG', '', '', '', '', '', 'Rebeca Mingo', '695197265', NULL, NULL, NULL, 'En visita', 'Comunicada'),
