(1587, '2015-05-13 14:04:47', NULL, 2786, 5889, NULL, 'Avería', 0, 1, 0, 0, 'A CAUSA DEL ROBO QUE SUCEDIO EL MES DE MARZO, ARRANCARON EL PANEL ENTERO DESTROZANDO TODOS LOS TERMINALES.\nABRIMOS INCIDENCIA DE TODOS LOS TERMINALES PERO VEO QUE LAS HAN CERRADO Y NO HAN ARREGLADO NADA.\nRUEGO VUELVAN A ABRIR LA INCIDENCIA Y VENGAN LO ANTES POSIBLE YA QUE LLEVAMOS 3 MESES SIN EL PANEL QUE JUSTO ESTA EN LA ENTRADA DE LA TIENDA Y DA MUY MALA IMAGEN.\nGRACIAS', 'es necesario enviar todo .soportes cableado centralita telefonos, etc todo para tener el mueble ok\n\nhablado con tienda a la espera que nos avisen que esta el mueble ok\n\n14/05\n\nivan', '', '', '', '', '', '', 'SHEILA LOPEZ', '937231755', NULL, NULL, NULL, 'En proceso', 'Revisada'),
(1588, '2015-05-13 14:06:53', NULL, 2786, 5894, NULL, 'Avería', 0, 1, 0, 0, 'BUENAS TARDES,\n\nABRIMOS INCIDENCIA PARA TODOS LOS DISPOSITIVOS YA QUE A CAUSA DEL ROBO NO SE LLEVARON TODO EXCEPTO LA TABLET DE SONY Y VEO QUE HABEIS CERRADO LA INCIDENCIA PERO SEGUIMOS SIN NINGUNA TABLET. LOS TECNICOS QUE VINIERON SE LLEVARON INCLUSO LA DE SAMSUNG,\nRUEGO VUELVAN A ABRIR INCIENCIA Y VENGAN LO ANTS POSIBLE. EN LAS INCIDENCIAS QUE YA ESTABAN ABIERTAS HE ADJUNTADO FOTO DE LOS DOS PANELADOS VACIOS.\nGRACIAS', 'ENVIAR GARRAS Y SOPORTES MAS CABLES DE CARGA\n\nENVIAR TAMBIEN TODAS LAS TABLETS YA QUE LAS QUE NO LES ROBARON SE LAS LLEVARON LOS TECNICOS\n\nHABLADO CON TIENDA EL 14/05\nivan', '', '', '', '', '', '', 'SHEILA LOPEZ', '937231755', NULL, NULL, NULL, 'En proceso', 'Revisada'),
