(1650, '2015-05-18 11:06:15', NULL, 2859, 6533, 4948, 'Avería', 0, 0, 1, 1, 'SOPORTE/ANCLAJE: EL IPHONE TIENE EL ANCLAJE ROTO, EL DISCO EN CONTACTO CON EL TERMINAL. EN LA ULTIMA VISITA NO PUDIERON REPARARLO PORQUE LES FALTABA LA PIEZA, NO RECORDAMOS MUY BIEN.\nALARMA/CABLEADO: LA ALARMA PITA CONTINUAMENTE. EN LA ULTIMA VISITA NO PUDIERON REPARARLO POR FALTA DE LA PILA.', '', '', '', '', '', '', '', 'NURIA JIMENEZ CASTILLO', '968197473', NULL, NULL, NULL, 'Alta realizada', 'Nueva'),
(1651, '2015-05-18 11:08:25', NULL, 2859, 6539, 4953, 'Avería', 1, 0, 0, 0, 'LA TABLET ENCIENDE TY FUNCIONA PERO LA PANTALLA SE VE MUY MAL, PARPADEA Y TIENE LOS PIXELES BORROSOS, APARECEN RAYAS.\n', '', '', '', '', '', '', '', 'NURIA JIMENEZ CASTILLO', '968197473', NULL, NULL, NULL, 'Alta realizada', 'Nueva'),
(1652, '2015-05-18 11:28:46', NULL, 2859, 6539, 4955, 'Avería', 0, 0, 0, 1, 'EN LA ULTIMA VISITA REALIZADA, NO PUDIERON DEJARLO COLOCADO PORQUE UNA DE LAS ABRAZADERAS QUE AGARRA AL TERMINAL NO LA TENEMOS, ESTÁ PERDIDA.', '', '', '', '', '', '', '', 'NURIA JIMENEZ CASTILLO', '968197473', NULL, NULL, NULL, 'Alta realizada', 'Nueva'),
(1653, '2015-05-18 11:31:10', NULL, 2859, 6537, NULL, 'Avería', 0, 1, 0, 0, 'TENEMOS LA LLAVE PUESTA EN LA CERRADURA DE LA DESACTIVACION DE LA ALARMA DE TODO EL PANEL EN POSICION OFF PORQUE SI LA COLOCAMOS EN POSICION ON LA ALARMA SUENA.', '', '', '', '', '', '', '', 'NURIA JIMENEZ CASTILLO', '968197473', NULL, NULL, NULL, 'Alta realizada', 'Nueva'),
(1654, '2015-05-18 11:32:26', NULL, 2859, 6532, 4945, 'Avería', 1, 0, 0, 1, 'LA PARTE DE ATRAS DEL TELEFONO ESTÁ DESPEGADA EN LA PARTE SUPERIOR. ADEMÁS, LA PIEZA QUE CONECTA AL CARGADOR ESTÁ SUELTA.', '', '', '', '', '', '', '', 'NURIA JIMENEZ CASTILLO', '968197473', NULL, NULL, NULL, 'Alta realizada', 'Nueva'),
